const nodemailer = require('nodemailer');
const dotEnv = require('dotenv');

dotEnv.config();

const transporter = nodemailer.createTransport({
    service: process.env.MAIL_SERVICE,
    auth: {
        user: process.env.MAIL_USER,
        pass: process.env.MAIL_PASSWORD
    }
});

const throttlingTimeout = 5 * 1000;
let throttlingTimerId;

function sendEmailAlert() {

    if (!process.env.MAIL_ENABLED) {
        return;
    }

    const mailOptions = {
        from: process.env.MAIL_FROM,
        to: process.env.MAIL_TO,
        subject: 'Token ✔',
        text: 'I am here',
        html: '<b>I am here</b>',
        attachments: [
            {
                filename: 'kotojeleń.jpg',
                path: 'data:image/jpeg;base64,'
            }
        ]
    };

    transporter.sendMail(mailOptions, (error, info) => {
        if (error) {
            return console.log(error);
        }
        console.log('Message %s sent: %s', info.messageId, info.response);
        return true;
    });
}

function sendThrottledEmailAlert() {

    if (throttlingTimerId) {
        return;
    }

    throttlingTimerId = setTimeout(function () {
        clearTimeout(throttlingTimerId);
        throttlingTimerId = null;
    }, throttlingTimeout);

    sendEmailAlert();
}

module.exports = {
    sendEmailAlert: sendEmailAlert,
    sendThrottledEmailAlert: sendThrottledEmailAlert
};